import styled from "styled-components";
import {createGlobalStyle} from 'styled-components'


export const GlobalStyle = createGlobalStyle`
  body{
    margin: 0;
    padding: 0;
    font-size: 14px;
    line-height: 1.42857143;
    color: #333333;
    background-color: #f8f8fa;
  }
`
